// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awCommandRenderFunction } from 'js/AwCommandService';


/*
ctx imports
*/
import { getCommandClassMemo as commandClass } from 'js/AwCommandService';
const ctxImportObj = { commandClass };


/*
dynamic import
 */
registerDynImportEntry('js/AwCommandService', () => import('js/AwCommandService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "_swfCommandComponent": true
    },
    "actions": {
        "render": {
            "method": "awCommandRenderFunction",
            "options": {
                "elementRefList": [
                    "cmdState"
                ]
            },
            "deps": "js/AwCommandService"
        },
        "openCommandPopup": {
            "actionType": "popup",
            "options": {
                "advancePositioning": true,
                "autoFocus": true,
                "clickOutsideToClose": true,
                "closeWhenEsc": true,
                "flipBehavior": "opposite",
                "selectedElementCSS": ".aw-state-selected",
                "toggleMode": true,
                "whenParentScrolls": "follow",
                "forceCloseOthers": false
            }
        }
    },
    "ctx": {
        "commandClass": {
            "parser": {
                "method": "getCommandClassMemo",
                "deps": "js/AwCommandService"
            }
        }
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "AwCommand",
    "_uniqueViewModelId": "AwCommand"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awCommandRenderFunction, {"elementRefList":["cmdState"]}, ctxImportObj );

export default Component;
